import React from "react"
import Header from "./Header"
import { BrowserRouter as Router,Routes} from "react-router-dom"

class App extends React.Component{
    render(){
        return(
            <div>
                <Routes>
                    <Router>
                        <Header></Header>
                    </Router>
                </Routes>
                
                
            </div>
        )
    }
}

export default App
